    [],nt"num_tags": 0,nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-temperature-salinity-d6630",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0116642 includes chemical,
    discrete sample, physical and profile data collected from POLARSTERN in the South
    Atlantic Ocean from 1986-06-27 to 1986-12-14 and retrieved during cruise ANT V/2_1986.
    These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12),
    DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, Delta
    Oxygen - 18, HELIUM, HYDROSTATIC PRESSURE, NEON, NITRATE, NITRITE, PHOSPHATE, Partial
    pressure (or fugacity) of carbon dioxide, Potential temperature (theta), SALINITY,
    SILICATE, Tritium (Hydrogen isotope) and WATER TEMPERATURE. The instruments used
    to collect these data include CTD and bottle. These data were collected by Taro
    Takahashi of Columbia University; Lamont-Doherty Earth Observatory and E. Augstein
    of Gothenburg University; Department of Analytical and Marine Chemistry as part
    of the ANT_V2_1986 data set.nnThe International CLIVAR Global Ocean Carbon and Repeat
    Hydrography Program carries out a systematic and global re-occupation of select
    WOCE/JGOFS hydrographic sections to quantify changes in storage and transport of
    heat, fresh water, carbon dioxide (CO2), and related parameters.",nt"owner_org":
